import React from 'react'
import Link from 'next/link'
import {NavFlex, NavLink } from './style'


const NavBar = () => {
    return (
        <NavFlex>
            <NavLink href="/about"><a>Bekir</a></NavLink>
        </NavFlex>
    )
}

export default NavBar
